def dfs(graph, start, visited, path):
    visited[start] = True
    path.append(start)
    for i in range(len(graph)):
        if graph[start][i] == 1 and not visited[i]:
            dfs(graph, i, visited, path)
    return path

def all_paths(graph):
    n = len(graph)
    paths = []
    for i in range(n):
        visited = [False] * n
        path = []
        paths.append(dfs(graph, i, visited, path))
    return paths

