def prime_factors(n):
    factors = []
    i = 2
    while i * i <= n:
        if n % i:
            i += 1
        else:
            n //= i
            factors.append(i)
    if n > 1:
        factors.append(n)
    return factors

def divisor_sum(n, p):
    factors = prime_factors(p)
    sums = []
    for f in factors:
        if f ** (n - 1) > p:
            break
        for k in range(1, n):
            if f ** k > p:
                break
            sums.append(f ** k)
    return sum(sorted(sums, reverse=True))

