def top_degree(matrix):
    n = len(matrix)
    degree = [0] * n
    for i in range(n):
        for j in range(n):
            if matrix[i][j] == 1:
                degree[i] += 1
                degree[j] += 1
    for i in range(n):
        for j in range(i, n):
            if degree[i] < degree[j]:
                degree[i], degree[j] = degree[j], degree[i]
    for i in range(n):
        print(i+1, degree[i])

