def dfs(graph, visited, current, path):
    visited[current] = True
    path.append(current)

    for neighbor in range(len(graph[current])):
        if not visited[neighbor] and graph[current][neighbor] == 1:
            dfs(graph, visited, neighbor, path)

    return path

