def banquet(n, a, b, t):
    tables = [a, b]
    denied = 0
    for i in range(n):
        if t[i] == 1:
            if tables[0] > 0:
                tables[0] -= 1
            elif tables[1] > 1 and tables[1] > tables[0]:
                tables[1] -= 1
                tables[0] += 1
            else:
                denied += 1
        else:
            if tables[1] > 0:
                tables[1] -= 1
            else:
                denied += 2
    return denied

