def dfs(adj, visited, v, parent):
    visited[v] = True
    for u in range(len(adj)):
        if adj[v][u] == 1:
            if not visited[u]:
                if dfs(adj, visited, u, v):
                    return True
            else:
                if u != parent:
                    return True
    return False

def is_cycle(adj):
    visited = [False] * len(adj)
    for v in range(len(adj)):
        if not visited[v]:
            if dfs(adj, visited, v, -1):
                return True
    return False

