def count_attacked_squares(position):
    letter, number = position
    x = ord(letter) - ord('a')
    y = int(number) - 1
    attacked_squares = 0

    for dx in [-2, -1, 1, 2]:
        for dy in [-2, -1, 1, 2]:
            if abs(dx) == abs(dy):
                continue
            nx, ny = x + dx, y + dy
            if 0 <= nx < 8 and 0 <= ny < 8:
                attacked_squares += 1

    return attacked_squares


